import React, { useState } from "react";
import "./SignIn.css"; // Import the CSS file

const SignIn = () => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [rememberMe, setRememberMe] = useState(false);

  const handleSignIn = () => {
    // Logic for handling sign-in with username, password, and rememberMe state
    console.log("Signing in...");
    console.log("Username:", username);
    console.log("Password:", password);
    console.log("Remember Me:", rememberMe);
    // You can implement your authentication logic here
  };

  const handleRegister = () => {
    // Logic for handling registration
    console.log("Redirecting to registration...");
    // Implement redirection to registration page
  };

  const handleForgotPassword = () => {
    // Logic for handling forgotten password
    console.log("Redirecting to forgot password...");
    // Implement redirection to forgot password page
  };

  return (
    <div className="signin-container">
      <div className="signin-box">
        <h2>Sign In</h2>
        <div>
          <label>Username:</label>
          <input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
          />
        </div>
        <div>
          <label>Password:</label>
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
        </div>
        <div>
          <label>
            <input
              type="checkbox"
              checked={rememberMe}
              onChange={() => setRememberMe(!rememberMe)}
            />
            Remember Me
          </label>
        </div>
        <div>
          <button onClick={handleSignIn}>Sign In</button>
          <button onClick={handleRegister}>Register Now</button>
        </div>
        <div>
          <button onClick={handleForgotPassword}>Forgot Password?</button>
        </div>
      </div>
    </div>
  );
};

export default SignIn;
